import './App.css';
import React from 'react';
import Buscador from './components/Buscador';
import Oficios from './components/Oficios';

//import HeaderPrime from './components/HeaderPrime';
function App() {
  return (
    <div className="App">
    <main className="indexmain">
    <div className="texto1">
    <h2>El Oficio para vos</h2>
    <p>
      La aplicación que te permitirá encontrar los mejores profesionales de
      manera fácil y rápida.
    </p>
    </div>

    <div className="buscador-wrapper">
    <Buscador/>
    </div>

    <section className="contenedorCarrusel2">
    <section id="propaganda1"></section>
    </section>

    <section className="contenedorCarrusel1">
    <h3>Categorías relevantes</h3>
    <section id="oficio-container"></section>

    <div className="cajaBtn1">
    <button id="anterior1">&#60;</button>
    <h2 className="catalogoCartel">Oficios</h2>
    <button id="siguiente1">&#62;</button>
    </div>

    </section>

    </main>

    </div> 
  );
}
export default App;
